import React,{useState} from 'react';
import './App.css';

//Containers
import Main from "./containers/Main";
import Header from './containers/Header';
import Footer from './containers/Footer';

//Components
import MainFoodArticle from './components/MainFoodArticle';

import SearchBar from './components/SearchBar';
import Trending from './components/Trending';
import Highest from "./components/Highest";


export default function App (){
  const [isGuyClicked,setIsGuyClicked]=useState(false);

  return(
    <div className="app" id='app'>

      <Header>
        <h1 className="title">FlavorTown</h1>
        <SearchBar /> 
      </Header>

      {isGuyClicked?
      <Main>
        'Yes'
      </Main>
      :
      <Main>
        'No'
      </Main>
      }
      {/* <Main>
        {isGuyClicked?<div>'Yes'</div>:
        <div>
          <MainFoodArticle/>
          <Trending /> 
          <Highest />
        </div>
        }
      </Main> */}

    <Footer>
      <img src="https://myrealdomain.com/images/guy-fieri-png-1.png" width="100px" height="100px" alt='' className="guysRandom__image"/>
      <button className='guysRandom__button' onClick={()=>setIsGuyClicked(!isGuyClicked)}>Give Me a Guy's Random!</button>
    </Footer>
    </div>
  )
}
